import React, { Component } from 'react';

class Select extends Component {
    constructor(props){

        super(props);
        const names = [
            {
                id : 1,
                client : "Ram"
            }, 
            {
                id : 2,
                client : "Jaya",
            }, 
            {
                id : 3,
                client : "Vinod",
            }, 
            {
                id : 4,
                client : "Vijay"
            }, 
        ]
    }
    render() {
        return (
            <div>
                <select>
                    {this.names.map(
                        <option name={name=>name.id}>{name=>name.client}</option>
                    )}
                </select>

            </div>
        );
    }
}

export default Select;
